import React from 'react'

export default function BodyPartBox() {
  return (
    <div>
        <button onClick={setBodyPart(1)}>Head</button>
        <button onClick={setBodyPart(2)}>Body</button>
        <button onClick={setBodyPart(3)}>Tail</button>
    </div>
  )
}
